const Card = () => (

    <div classname="card">
        <img scr="https://i.imgur.com/aadwyfC.jpg" alt="Imagem Ilustrativa" className="card-image"/>
        <p className="subject">Algoritmos e Programção</p>
        <h1 className="card-task"></h1>
    </div>


);

export default Card;
